import { useState } from "react";
import "./styles.scss";

const Portfolio = () => {

  const [project, setProject] = useState("shadow");

  return (
    <article id="portfolio">
    <div className="project">
      <label for="shadow">
        <span>Shadow</span>
        <div />
      </label>
      <input checked={project==="shadow"? true: false} id="shadow"
        name="project" type="radio"
        onChange={() => {
          setProject("shadow");
        }}
      />
      <div className="overview" />
    </div>
      <div className="project">
        <label for="tussle">
          <span>Tussle</span>
          <div />
        </label>
        <input checked={project==="tussle"? true: false} id="tussle"
          name="project"  type="radio"
          onChange={() => {
            setProject("tussle");
          }}
        />
        <div />
      </div>
    </article>
  )
}

export default Portfolio
